export default function ItemList({
category,
  notebookProduct,
  desktopProduct,
}) {
  return (
    <div>
      {(category == "notebook") ? (
       <h1>Notebook</h1>)
       : (
       <h1>Des</h1>
      )}
    </div>
  );
}
